import { useEffect } from 'react';
import './App.css';
import Header from '../Components/Header';
import Body from '../Components/Body';

function App() {
  var data;
  useEffect(() => {
    fetch("/home")
    .then(res => res.text())
    .then(data = res)
  }, [])

  return (
    <div className="Home">
      <Header/>
      <Body/>
      <p>{data}</p>
    </div>
  );
}

export default App;
